import logo from '../logo.svg';
import '../App.css';

function Art(props) {

    if(props.data != null) {
        let artistName = props.data.artistDisplayName;
        let artURL = props.data.primaryImag;
        let artTitle = props.data.title;
        console.log("Art ", props.data.primaryImage, props.data.artistDisplayName, props.data.title);
    }

    return (
        <div className="App">
        <header className="App-header">
            <img src={artURL} className="App-logo" alt="logo" />
            <p>{ artTitle }</p>
            <p>{ artistName } </p>
        </header>
        </div>
    );
}

export default Art;
